import { SearchOutlined } from '@ant-design/icons'
import { Avatar } from 'antd'
import React, { useState } from 'react'
import userlist from '../Home/image/user-list.png'
import usrergroup from '../Home/image/group.png'
import mail from '../Home/image/envelope.png'
export default function SideBar() {
    const [isHovered, setHovered] = useState(false);
    const [isHovered1, setHovered1] = useState(false);
    const [isHovered2, setHovered2] = useState(false);
    const handleMouseEnter = () => {
        setHovered(true);
    };
    const handleMouseLeave = () => {
        setHovered(false);
    };
    const handleMouseEnter1 = () => {
        setHovered1(true);
    };
    const handleMouseLeave1 = () => {
        setHovered1(false);
    };
    const handleMouseEnter2 = () => {
        setHovered2(true);
    };
    const handleMouseLeave2 = () => {
        setHovered2(false);
    };
    return (
        <div style={{ height: '100vh', display: 'flex', flexDirection: 'column', borderRight: '1px solid #CCCCCC' }}>
            <div style={{ display: 'flex', width: 384, height: 80, borderBottom: '1px solid #CCCCCC', alignItems: 'center' }}>
                <div style={{ background: '#e4e8ec', marginLeft: 10, display: 'flex', width: 270, height: 30, borderRadius: 10 }}>
                    <SearchOutlined style={{ marginLeft: 7, marginRight: 10, fontSize: 25, color: 'gray' }} />
                    <input style={{ border: 'none', outline: 'none', borderRadius: 10, width: 400, background: '#e4e8ec' }} placeholder='Tìm Kiếm'></input>
                </div>
                <SearchOutlined style={{ marginLeft: 20, marginRight: 20, fontSize: 25, color: 'gray' }} />
                <SearchOutlined style={{ fontSize: 25, color: 'gray' }} />
            </div>
            <div style={{ height: '100vh', overflowY: 'scroll', overflowX: 'visible', flexDirection: 'column' }}>
                <div style={{ display: 'flex', width: 384, height: 50, borderBottom: '1px solid #CCCCCC', alignItems: 'center', gap: 10, background: isHovered ? '#CCCCCC' : 'transparent' }} onMouseEnter={handleMouseEnter} onMouseLeave={handleMouseLeave}>
                    <img src={userlist} height={30} width={30} />
                    <div>
                        <text style={{ fontSize: 18, fontWeight: 'bold' }}>Danh sách bạn bè</text>
                    </div>
                </div>
                <div style={{ display: 'flex', width: 384, height: 50, borderBottom: '1px solid #CCCCCC', alignItems: 'center', gap: 10, background: isHovered1 ? '#CCCCCC' : 'transparent' }} onMouseEnter={handleMouseEnter1} onMouseLeave={handleMouseLeave1}>
                    <img src={usrergroup} height={30} width={30} />
                    <div>
                        <text style={{ fontSize: 18, fontWeight: 'bold' }}>Danh sách bạn bè</text>
                    </div>
                </div>
                <div style={{ display: 'flex', width: 384, height: 50, borderBottom: '1px solid #CCCCCC', alignItems: 'center', gap: 10, background: isHovered2 ? '#CCCCCC' : 'transparent' }} onMouseEnter={handleMouseEnter2} onMouseLeave={handleMouseLeave2}>
                    <img src={mail} height={30} width={30} />
                    <div>
                        <text style={{ fontSize: 18, fontWeight: 'bold' }}>Danh sách bạn bè</text>
                    </div>
                </div>


            </div>
        </div>
    )
}
